import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="ui secondary pointing menu">
      <Link to="/" className="item">
        Streamy
      </Link>
      <div className="right menu">Header</div>
      <Link to="/" className="item">
        All Streams
      </Link>
    </div>
  );
};

export default Header;
